                    { 140, 11, 0, "[\"\\u041D\\u0435 \\u0437\\u0430\\u0432\\u0436\\u0434\\u0438 \\u0447\\u0435\\u0440\\u0435\\u0437 \\u043D\\u0430\\u043A\\u043B\\u0430\\u0434\\u043D\\u0456 \\u0432\\u0438\\u0442\\u0440\\u0430\\u0442\\u0438 \\u043D\\u0430 \\u043F\\u0456\\u0434\\u0440\\u0430\\u0445\\u0443\\u043D\\u043E\\u043A \\u0447\\u0430\\u0441\\u0442\\u043E\\u0442\",\"\\u0422\\u0430\\u043A, \\u0437\\u0430\\u0432\\u0436\\u0434\\u0438\",\"\\u041B\\u0438\\u0448\\u0435 \\u0443 \\u0431\\u0430\\u0433\\u0430\\u0442\\u043E\\u043F\\u043E\\u0442\\u043E\\u043A\\u043E\\u0432\\u0438\\u0445 \\u0441\\u0435\\u0440\\u0435\\u0434\\u043E\\u0432\\u0438\\u0449\\u0430\\u0445\",\"\\u041B\\u0438\\u0448\\u0435 \\u0443 \\u0441\\u0438\\u0441\\u0442\\u0435\\u043C\\u0430\\u0445 \\u0440\\u0435\\u0430\\u043B\\u044C\\u043D\\u043E\\u0433\\u043E \\u0447\\u0430\\u0441\\u0443\"]", "Чи підходить LFU для робочих навантажень, які потребують швидкого доступу до даних?" },
                    { 141, 11, 0, "[\"\\u0412\\u0438\\u043A\\u043E\\u0440\\u0438\\u0441\\u0442\\u043E\\u0432\\u0443\\u0432\\u0430\\u0442\\u0438 \\u0433\\u0456\\u0431\\u0440\\u0438\\u0434\\u043D\\u0456 \\u043F\\u0456\\u0434\\u0445\\u043E\\u0434\\u0438, \\u0442\\u0430\\u043A\\u0456 \\u044F\\u043A LFU-LRU\",\"\\u041D\\u0435 \\u043F\\u0440\\u043E\\u0432\\u043E\\u0434\\u0438\\u0442\\u0438 \\u0437\\u0430\\u043C\\u0456\\u043D\\u0443 \\u0441\\u0442\\u043E\\u0440\\u0456\\u043D\\u043E\\u043A\",\"\\u0417\\u0431\\u0456\\u043B\\u044C\\u0448\\u0438\\u0442\\u0438 \\u0440\\u043E\\u0437\\u043C\\u0456\\u0440 \\u043A\\u0435\\u0448\\u0443\",\"\\u0412\\u0438\\u043A\\u043E\\u0440\\u0438\\u0441\\u0442\\u043E\\u0432\\u0443\\u0432\\u0430\\u0442\\u0438 \\u043C\\u0435\\u043D\\u0448\\u0435 \\u043F\\u0430\\u043C\\u0027\\u044F\\u0442\\u0456\"]", "Як можна оптимізувати роботу алгоритму LFU?" },
                    { 142, 11, 0, "[\"\\u0427\\u0435\\u0440\\u0435\\u0437 \\u0437\\u0431\\u0435\\u0440\\u0435\\u0436\\u0435\\u043D\\u043D\\u044F \\u0441\\u0442\\u043E\\u0440\\u0456\\u043D\\u043E\\u043A \\u0437 \\u0456\\u0441\\u0442\\u043E\\u0440\\u0438\\u0447\\u043D\\u043E \\u0432\\u0438\\u0441\\u043E\\u043A\\u043E\\u044E \\u0447\\u0430\\u0441\\u0442\\u043E\\u0442\\u043E\\u044E\",\"\\u0427\\u0435\\u0440\\u0435\\u0437 \\u043F\\u043E\\u0441\\u0442\\u0456\\u0439\\u043D\\u0435 \\u043E\\u043D\\u043E\\u0432\\u043B\\u0435\\u043D\\u043D\\u044F \\u0447\\u0430\\u0441\\u0442\\u043E\\u0442\",\"\\u0427\\u0435\\u0440\\u0435\\u0437 \\u0432\\u0438\\u043F\\u0430\\u0434\\u043A\\u043E\\u0432\\u0438\\u0439 \\u0432\\u0438\\u0431\\u0456\\u0440 \\u0441\\u0442\\u043E\\u0440\\u0456\\u043D\\u043E\\u043A\",\"\\u0427\\u0435\\u0440\\u0435\\u0437 \\u0432\\u0438\\u043A\\u043E\\u0440\\u0438\\u0441\\u0442\\u0430\\u043D\\u043D\\u044F \\u0447\\u0430\\u0441\\u043E\\u0432\\u0438\\u0445 \\u043C\\u0456\\u0442\\u043E\\u043A\"]", "Чому LFU може призводити до 'застиглих' сторінок (stale pages)?" },
                    { 143, 11, 0, "[\"LFU \\u0432\\u0438\\u043A\\u043E\\u0440\\u0438\\u0441\\u0442\\u043E\\u0432\\u0443\\u0454 \\u0447\\u0430\\u0441\\u0442\\u043E\\u0442\\u0438, \\u0430 LRU \\u2014 \\u0447\\u0430\\u0441 \\u043E\\u0441\\u0442\\u0430\\u043D\\u043D\\u044C\\u043E\\u0433\\u043E \\u0434\\u043E\\u0441\\u0442\\u0443\\u043F\\u0443\",\"LFU \\u0441\\u043A\\u043B\\u0430\\u0434\\u043D\\u0456\\u0448\\u0438\\u0439 \\u0437\\u0430 LRU\",\"LFU \\u043C\\u0435\\u043D\\u0448 \\u0435\\u0444\\u0435\\u043A\\u0442\\u0438\\u0432\\u043D\\u0438\\u0439 \\u0437\\u0430 LRU\",\"LRU \\u043F\\u0440\\u0430\\u0446\\u044E\\u0454 \\u0448\\u0432\\u0438\\u0434\\u0448\\u0435 \\u0437\\u0430 LFU \\u0443 \\u0432\\u0441\\u0456\\u0445 \\u0432\\u0438\\u043F\\u0430\\u0434\\u043A\\u0430\\u0445\"]", "У чому різниця між LFU та LRU?" },
                    { 144, 11, 0, "[\"\\u0425\\u0435\\u0448-\\u0442\\u0430\\u0431\\u043B\\u0438\\u0446\\u044F \\u0437 \\u043F\\u0440\\u0456\\u043E\\u0440\\u0438\\u0442\\u0435\\u0442\\u043D\\u043E\\u044E \\u0447\\u0435\\u0440\\u0433\\u043E\\u044E\",\"\\u041E\\u0434\\u043D\\u043E\\u0437\\u0432\\u2019\\u044F\\u0437\\u043D\\u0438\\u0439 \\u0441\\u043F\\u0438\\u0441\\u043E\\u043A\",\"\\u041A\\u0440\\u0443\\u0433\\u043E\\u0432\\u0438\\u0439 \\u0431\\u0443\\u0444\\u0435\\u0440\",\"\\u041C\\u043D\\u043E\\u0436\\u0438\\u043D\\u0430\"]", "Яка структура даних найчастіше використовується для реалізації LFU?" },
