                    { 148, 11, 0, "[\"\\u0417\\u043C\\u0435\\u043D\\u0448\\u0443\\u0454 \\u0432\\u043F\\u043B\\u0438\\u0432 \\u0456\\u0441\\u0442\\u043E\\u0440\\u0438\\u0447\\u043D\\u0438\\u0445 \\u0447\\u0430\\u0441\\u0442\\u043E\\u0442\",\"\\u041F\\u0456\\u0434\\u0432\\u0438\\u0449\\u0443\\u0454 \\u043F\\u0440\\u0456\\u043E\\u0440\\u0438\\u0442\\u0435\\u0442 \\u043D\\u043E\\u0432\\u0438\\u0445 \\u0441\\u0442\\u043E\\u0440\\u0456\\u043D\\u043E\\u043A\",\"\\u0412\\u0438\\u0434\\u0430\\u043B\\u044F\\u0454 \\u043D\\u0430\\u0439\\u0441\\u0442\\u0430\\u0440\\u0456\\u0448\\u0456 \\u0441\\u0442\\u043E\\u0440\\u0456\\u043D\\u043A\\u0438\",\"\\u0412\\u0438\\u043A\\u043E\\u0440\\u0438\\u0441\\u0442\\u043E\\u0432\\u0443\\u0454 \\u0432\\u0438\\u043F\\u0430\\u0434\\u043A\\u043E\\u0432\\u0443 \\u0437\\u0430\\u043C\\u0456\\u043D\\u0443\"]", "Як працює адаптивний LFU?" },
                    { 149, 11, 0, "[\"\\u0421\\u0438\\u0441\\u0442\\u0435\\u043C\\u0438 \\u0437 \\u043F\\u043E\\u0432\\u0442\\u043E\\u0440\\u044E\\u0432\\u0430\\u043D\\u0438\\u043C\\u0438 \\u0448\\u0430\\u0431\\u043B\\u043E\\u043D\\u0430\\u043C\\u0438 \\u0434\\u043E\\u0441\\u0442\\u0443\\u043F\\u0443 \\u0434\\u043E \\u0434\\u0430\\u043D\\u0438\\u0445\",\"\\u0421\\u0438\\u0441\\u0442\\u0435\\u043C\\u0438 \\u0440\\u0435\\u0430\\u043B\\u044C\\u043D\\u043E\\u0433\\u043E \\u0447\\u0430\\u0441\\u0443\",\"\\u041E\\u0434\\u043D\\u043E\\u0437\\u0430\\u0434\\u0430\\u0447\\u043D\\u0456 \\u0441\\u0438\\u0441\\u0442\\u0435\\u043C\\u0438\",\"\\u0421\\u0438\\u0441\\u0442\\u0435\\u043C\\u0438 \\u0437 \\u0440\\u0456\\u0434\\u043A\\u0438\\u043C \\u0434\\u043E\\u0441\\u0442\\u0443\\u043F\\u043E\\u043C \\u0434\\u043E \\u0434\\u0430\\u043D\\u0438\\u0445\"]", "Яке середовище краще підходить для використання LFU?" },
