                    { 151, 12, 0, "[\"\\u0427\\u0430\\u0441\\u0442\\u043E \\u0432\\u0438\\u0434\\u0430\\u043B\\u044F\\u0454 \\u0441\\u0442\\u043E\\u0440\\u0456\\u043D\\u043A\\u0438, \\u044F\\u043A\\u0456 \\u0432\\u0441\\u0435 \\u0449\\u0435 \\u043F\\u043E\\u0442\\u0440\\u0456\\u0431\\u043D\\u0456\",\"\\u0412\\u0438\\u043C\\u0430\\u0433\\u0430\\u0454 \\u0437\\u043D\\u0430\\u0447\\u043D\\u043E\\u0433\\u043E \\u043E\\u0431\\u0441\\u044F\\u0433\\u0443 \\u043F\\u0430\\u043C\\u0027\\u044F\\u0442\\u0456\",\"\\u041D\\u0435 \\u043F\\u0456\\u0434\\u0442\\u0440\\u0438\\u043C\\u0443\\u0454 \\u0447\\u0430\\u0441\\u0442\\u043E\\u0442\\u0438 \\u0434\\u043E\\u0441\\u0442\\u0443\\u043F\\u0443\",\"\\u041F\\u0440\\u0430\\u0446\\u044E\\u0454 \\u043B\\u0438\\u0448\\u0435 \\u0443 \\u0432\\u0435\\u043B\\u0438\\u043A\\u0438\\u0445 \\u0441\\u0438\\u0441\\u0442\\u0435\\u043C\\u0430\\u0445\"]", "Чому алгоритм MFU може бути неефективним у деяких сценаріях?" },
                    { 152, 12, 0, "[\"\\u0412\\u0438\\u043A\\u043E\\u0440\\u0438\\u0441\\u0442\\u043E\\u0432\\u0443\\u0454 \\u0447\\u0430\\u0441\\u043E\\u0432\\u0438\\u0439 \\u043C\\u0430\\u0440\\u043A\\u0435\\u0440\",\"\\u0412\\u0438\\u0434\\u0430\\u043B\\u044F\\u0454 \\u043F\\u0435\\u0440\\u0448\\u0443 \\u0441\\u0442\\u043E\\u0440\\u0456\\u043D\\u043A\\u0443 \\u0443 \\u0441\\u043F\\u0438\\u0441\\u043A\\u0443\",\"\\u041D\\u0435 \\u0437\\u0430\\u043C\\u0456\\u0449\\u0443\\u0454 \\u0441\\u0442\\u043E\\u0440\\u0456\\u043D\\u043A\\u0438\",\"\\u0412\\u0438\\u0434\\u0430\\u043B\\u044F\\u0454 \\u0441\\u0442\\u043E\\u0440\\u0456\\u043D\\u043A\\u0443 \\u0432\\u0438\\u043F\\u0430\\u0434\\u043A\\u043E\\u0432\\u0438\\u043C \\u0447\\u0438\\u043D\\u043E\\u043C\"]", "Як MFU вирішує конфлікт, якщо декілька сторінок мають однакову частоту використання?" },
                    { 153, 12, 0, "[\"\\u0425\\u0435\\u0448-\\u0442\\u0430\\u0431\\u043B\\u0438\\u0446\\u044F \\u0437 \\u043F\\u0440\\u0456\\u043E\\u0440\\u0438\\u0442\\u0435\\u0442\\u043D\\u043E\\u044E \\u0447\\u0435\\u0440\\u0433\\u043E\\u044E\",\"\\u041A\\u0440\\u0443\\u0433\\u043E\\u0432\\u0438\\u0439 \\u0431\\u0443\\u0444\\u0435\\u0440\",\"\\u041E\\u0434\\u043D\\u043E\\u0437\\u0432\\u0027\\u044F\\u0437\\u043D\\u0438\\u0439 \\u0441\\u043F\\u0438\\u0441\\u043E\\u043A\",\"\\u0414\\u0432\\u043E\\u0432\\u0438\\u043C\\u0456\\u0440\\u043D\\u0438\\u0439 \\u043C\\u0430\\u0441\\u0438\\u0432\"]", "Яка структура даних найчастіше використовується для реалізації MFU?" },
                    { 154, 12, 0, "[\"\\u0412\\u0438\\u0434\\u0430\\u043B\\u044F\\u0454 \\u0457\\u0445 \\u0443 \\u043F\\u0435\\u0440\\u0448\\u0443 \\u0447\\u0435\\u0440\\u0433\\u0443\",\"\\u0417\\u0430\\u043B\\u0438\\u0448\\u0430\\u0454 \\u0443 \\u043F\\u0430\\u043C\\u0027\\u044F\\u0442\\u0456\",\"\\u041F\\u0435\\u0440\\u0435\\u043C\\u0456\\u0449\\u0443\\u0454 \\u0457\\u0445 \\u0434\\u043E \\u043A\\u0456\\u043D\\u0446\\u044F \\u0441\\u043F\\u0438\\u0441\\u043A\\u0443\",\"\\u041E\\u0431\\u0027\\u0454\\u0434\\u043D\\u0443\\u0454 \\u0437 \\u0456\\u043D\\u0448\\u0438\\u043C\\u0438 \\u0441\\u0442\\u043E\\u0440\\u0456\\u043D\\u043A\\u0430\\u043C\\u0438\"]", "Як MFU поводиться зі сторінками, які використовувалися багато разів?" },
                    { 155, 12, 0, "[\"\\u0420\\u0456\\u0434\\u043A\\u043E \\u0447\\u0435\\u0440\\u0435\\u0437 \\u043F\\u043E\\u0432\\u0456\\u043B\\u044C\\u043D\\u0443 \\u0440\\u0435\\u0430\\u043A\\u0446\\u0456\\u044E \\u043D\\u0430 \\u0437\\u043C\\u0456\\u043D\\u0443 \\u0434\\u043E\\u0441\\u0442\\u0443\\u043F\\u0443 \\u0434\\u043E \\u0434\\u0430\\u043D\\u0438\\u0445\",\"\\u0417\\u0430\\u0432\\u0436\\u0434\\u0438 \\u0435\\u0444\\u0435\\u043A\\u0442\\u0438\\u0432\\u043D\\u043E\",\"\\u041B\\u0438\\u0448\\u0435 \\u0443 \\u0431\\u0430\\u0433\\u0430\\u0442\\u043E\\u0437\\u0430\\u0434\\u0430\\u0447\\u043D\\u0438\\u0445 \\u0441\\u0435\\u0440\\u0435\\u0434\\u043E\\u0432\\u0438\\u0449\\u0430\\u0445\",\"\\u041D\\u0435 \\u043F\\u0456\\u0434\\u0442\\u0440\\u0438\\u043C\\u0443\\u0454 \\u0440\\u0435\\u0430\\u043B\\u044C\\u043D\\u0438\\u0439 \\u0447\\u0430\\u0441\"]", "Чи може MFU працювати ефективно в системах реального часу?" },
                    { 156, 12, 0, "[\"\\u0427\\u0430\\u0441\\u0442\\u043E \\u0437\\u0430\\u043C\\u0456\\u043D\\u044E\\u0454 \\u043D\\u0435\\u043E\\u0431\\u0445\\u0456\\u0434\\u043D\\u0456 \\u0441\\u0442\\u043E\\u0440\\u0456\\u043D\\u043A\\u0438\",\"\\u0412\\u0438\\u043C\\u0430\\u0433\\u0430\\u0454 \\u0431\\u0430\\u0433\\u0430\\u0442\\u043E \\u0447\\u0430\\u0441\\u0443 \\u0434\\u043B\\u044F \\u0430\\u043D\\u0430\\u043B\\u0456\\u0437\\u0443\",\"\\u041F\\u0440\\u0430\\u0446\\u044E\\u0454 \\u043B\\u0438\\u0448\\u0435 \\u0437 LRU \\u044F\\u043A \\u0434\\u043E\\u043F\\u043E\\u043C\\u0456\\u0436\\u043D\\u0438\\u043C \\u0430\\u043B\\u0433\\u043E\\u0440\\u0438\\u0442\\u043C\\u043E\\u043C\",\"\\u041C\\u0430\\u0454 \\u0432\\u0438\\u0441\\u043E\\u043A\\u0443 \\u0432\\u0430\\u0440\\u0442\\u0456\\u0441\\u0442\\u044C \\u043E\\u0431\\u0447\\u0438\\u0441\\u043B\\u0435\\u043D\\u044C\"]", "Який недолік MFU у середовищах з невеликою кількістю сторінок?" },
                    { 157, 12, 0, "[\"LFU \\u0432\\u0438\\u0434\\u0430\\u043B\\u044F\\u0454 \\u043D\\u0430\\u0439\\u043C\\u0435\\u043D\\u0448 \\u0432\\u0438\\u043A\\u043E\\u0440\\u0438\\u0441\\u0442\\u043E\\u0432\\u0443\\u0432\\u0430\\u043D\\u0443 \\u0441\\u0442\\u043E\\u0440\\u0456\\u043D\\u043A\\u0443, MFU \\u2014 \\u043D\\u0430\\u0439\\u0447\\u0430\\u0441\\u0442\\u0456\\u0448\\u0435 \\u0432\\u0438\\u043A\\u043E\\u0440\\u0438\\u0441\\u0442\\u043E\\u0432\\u0443\\u0432\\u0430\\u043D\\u0443\",\"LFU \\u043F\\u0440\\u0430\\u0446\\u044E\\u0454 \\u0448\\u0432\\u0438\\u0434\\u0448\\u0435\",\"MFU \\u0432\\u0438\\u043A\\u043E\\u0440\\u0438\\u0441\\u0442\\u043E\\u0432\\u0443\\u0454 \\u043C\\u0435\\u043D\\u0448\\u0435 \\u043F\\u0430\\u043C\\u0027\\u044F\\u0442\\u0456\",\"\\u0423 \\u043D\\u0438\\u0445 \\u043E\\u0434\\u043D\\u0430\\u043A\\u043E\\u0432\\u0438\\u0439 \\u043F\\u0440\\u0438\\u043D\\u0446\\u0438\\u043F \\u0440\\u043E\\u0431\\u043E\\u0442\\u0438\"]", "Яка головна різниця між LFU та MFU?" },
                    { 158, 12, 0, "[\"\\u0417\\u0431\\u0456\\u043B\\u044C\\u0448\\u0443\\u0454\\u0442\\u044C\\u0441\\u044F \\u043A\\u043E\\u0436\\u043D\\u043E\\u0433\\u043E \\u0440\\u0430\\u0437\\u0443, \\u043A\\u043E\\u043B\\u0438 \\u0441\\u0442\\u043E\\u0440\\u0456\\u043D\\u043A\\u0430 \\u0432\\u0438\\u043A\\u043E\\u0440\\u0438\\u0441\\u0442\\u043E\\u0432\\u0443\\u0454\\u0442\\u044C\\u0441\\u044F\",\"\\u0417\\u043C\\u0435\\u043D\\u0448\\u0443\\u0454\\u0442\\u044C\\u0441\\u044F \\u0447\\u0435\\u0440\\u0435\\u0437 \\u043F\\u0435\\u0432\\u043D\\u0438\\u0439 \\u0447\\u0430\\u0441\",\"\\u041D\\u0435 \\u0437\\u043C\\u0456\\u043D\\u044E\\u0454\\u0442\\u044C\\u0441\\u044F\",\"\\u0412\\u0441\\u0442\\u0430\\u043D\\u043E\\u0432\\u043B\\u044E\\u0454\\u0442\\u044C\\u0441\\u044F \\u0432\\u0440\\u0443\\u0447\\u043D\\u0443\"]", "Як змінюється частота доступу у MFU?" },
                    { 159, 12, 0, "[\"\\u0421\\u0438\\u0441\\u0442\\u0435\\u043C\\u0438, \\u0434\\u0435 \\u0447\\u0430\\u0441\\u0442\\u043E \\u0432\\u0438\\u043A\\u043E\\u0440\\u0438\\u0441\\u0442\\u043E\\u0432\\u0443\\u0432\\u0430\\u043D\\u0456 \\u0441\\u0442\\u043E\\u0440\\u0456\\u043D\\u043A\\u0438 \\u0448\\u0432\\u0438\\u0434\\u043A\\u043E \\u0441\\u0442\\u0430\\u044E\\u0442\\u044C \\u0437\\u0430\\u0441\\u0442\\u0430\\u0440\\u0456\\u043B\\u0438\\u043C\\u0438\",\"\\u0421\\u0438\\u0441\\u0442\\u0435\\u043C\\u0438 \\u0440\\u0435\\u0430\\u043B\\u044C\\u043D\\u043E\\u0433\\u043E \\u0447\\u0430\\u0441\\u0443\",\"\\u0412\\u0435\\u043B\\u0438\\u043A\\u0456 \\u0431\\u0430\\u0437\\u0438 \\u0434\\u0430\\u043D\\u0438\\u0445\",\"\\u0421\\u0438\\u0441\\u0442\\u0435\\u043C\\u0438 \\u0437 \\u0432\\u0435\\u043B\\u0438\\u043A\\u0438\\u043C\\u0438 \\u043E\\u0431\\u0441\\u044F\\u0433\\u0430\\u043C\\u0438 \\u043F\\u0430\\u043C\\u0027\\u044F\\u0442\\u0456\"]", "Яка основна сфера застосування MFU?" },
                    { 160, 12, 0, "[\"\\u0422\\u0430\\u043A, \\u0437\\u0430 \\u0434\\u043E\\u043F\\u043E\\u043C\\u043E\\u0433\\u043E\\u044E \\u0430\\u0434\\u0430\\u043F\\u0442\\u0438\\u0432\\u043D\\u043E\\u0433\\u043E \\u043F\\u0456\\u0434\\u0445\\u043E\\u0434\\u0443\",\"\\u041D\\u0456, \\u0430\\u043B\\u0433\\u043E\\u0440\\u0438\\u0442\\u043C \\u0437\\u0430\\u043D\\u0430\\u0434\\u0442\\u043E \\u043F\\u0440\\u043E\\u0441\\u0442\\u0438\\u0439\",\"\\u0422\\u0456\\u043B\\u044C\\u043A\\u0438 \\u0434\\u043B\\u044F \\u0431\\u0430\\u0433\\u0430\\u0442\\u043E\\u043F\\u043E\\u0442\\u043E\\u043A\\u043E\\u0432\\u0438\\u0445 \\u0434\\u043E\\u0434\\u0430\\u0442\\u043A\\u0456\\u0432\",\"\\u0422\\u0456\\u043B\\u044C\\u043A\\u0438 \\u0437\\u0430 \\u043D\\u0430\\u044F\\u0432\\u043D\\u043E\\u0441\\u0442\\u0456 \\u0448\\u0432\\u0438\\u0434\\u043A\\u043E\\u0433\\u043E \\u043E\\u0431\\u043B\\u0430\\u0434\\u043D\\u0430\\u043D\\u043D\\u044F\"]", "Чи можна оптимізувати MFU для сучасних систем?" },
                    { 161, 12, 0, "[\"\\u0412\\u0438\\u0441\\u043E\\u043A\\u0430 \\u0441\\u043A\\u043B\\u0430\\u0434\\u043D\\u0456\\u0441\\u0442\\u044C \\u043E\\u0431\\u0447\\u0438\\u0441\\u043B\\u0435\\u043D\\u044C\",\"\\u041D\\u0435 \\u043F\\u0440\\u0430\\u0446\\u044E\\u0454 \\u0437 \\u0432\\u0435\\u043B\\u0438\\u043A\\u0438\\u043C\\u0438 \\u043E\\u0431\\u0441\\u044F\\u0433\\u0430\\u043C\\u0438 \\u0434\\u0430\\u043D\\u0438\\u0445\",\"\\u0412\\u0438\\u043C\\u0430\\u0433\\u0430\\u0454 \\u043D\\u0430\\u0434\\u0442\\u043E \\u043C\\u0430\\u043B\\u043E \\u0440\\u0435\\u0441\\u0443\\u0440\\u0441\\u0456\\u0432\",\"\\u041C\\u0430\\u0454 \\u0432\\u0438\\u0441\\u043E\\u043A\\u0443 \\u0448\\u0432\\u0438\\u0434\\u043A\\u0456\\u0441\\u0442\\u044C \\u0437\\u0430\\u043C\\u0456\\u0449\\u0435\\u043D\\u043D\\u044F\"]", "Які проблеми виникають при використанні MFU у великих системах?" },
                    { 162, 13, 0, "[\"\\u0412\\u0456\\u0434\\u043D\\u0456\\u043C\\u0430\\u0454 \\u043F\\u043E\\u0442\\u043E\\u0447\\u043D\\u0438\\u0439 \\u0440\\u043E\\u0437\\u043F\\u043E\\u0434\\u0456\\u043B \\u0432\\u0456\\u0434 \\u043C\\u0430\\u043A\\u0441\\u0438\\u043C\\u0430\\u043B\\u044C\\u043D\\u043E\\u0457 \\u043F\\u043E\\u0442\\u0440\\u0435\\u0431\\u0438\",\"\\u0421\\u0443\\u043C\\u0443\\u0454 \\u0432\\u0441\\u0456 \\u0437\\u0430\\u043F\\u0438\\u0442\\u0438 \\u043F\\u0440\\u043E\\u0446\\u0435\\u0441\\u0456\\u0432\",\"\\u041F\\u043E\\u0434\\u0432\\u043E\\u044E\\u0454 \\u043A\\u0456\\u043B\\u044C\\u043A\\u0456\\u0441\\u0442\\u044C \\u0437\\u0430\\u043F\\u0438\\u0442\\u0443\\u0432\\u0430\\u043D\\u0438\\u0445 \\u0440\\u0435\\u0441\\u0443\\u0440\\u0441\\u0456\\u0432\",\"\\u0414\\u043E\\u0434\\u0430\\u0454 \\u0432\\u0441\\u0456 \\u0432\\u0456\\u043B\\u044C\\u043D\\u0456 \\u0440\\u0435\\u0441\\u0443\\u0440\\u0441\\u0438 \\u0434\\u043E \\u043F\\u043E\\u0442\\u043E\\u0447\\u043D\\u0438\\u0445\"]", "Як алгоритм банкіра обчислює потребу процесу в ресурсах?" },
                    { 163, 13, 0, "[\"\\u0417\\u0430\\u043F\\u0438\\u0442 \\u0432\\u0456\\u0434\\u0445\\u0438\\u043B\\u044F\\u0454\\u0442\\u044C\\u0441\\u044F\",\"\\u041F\\u0440\\u043E\\u0446\\u0435\\u0441 \\u0437\\u0430\\u0432\\u0435\\u0440\\u0448\\u0443\\u0454\\u0442\\u044C\\u0441\\u044F\",\"\\u0421\\u0438\\u0441\\u0442\\u0435\\u043C\\u0430 \\u0432\\u0445\\u043E\\u0434\\u0438\\u0442\\u044C \\u0443 \\u0441\\u0442\\u0430\\u043D \\u0431\\u043B\\u043E\\u043A\\u0443\\u0432\\u0430\\u043D\\u043D\\u044F\",\"\\u0417\\u0430\\u043F\\u0438\\u0442 \\u0432\\u0438\\u043A\\u043E\\u043D\\u0443\\u0454\\u0442\\u044C\\u0441\\u044F \\u0447\\u0430\\u0441\\u0442\\u043A\\u043E\\u0432\\u043E\"]", "Що відбувається, якщо процес запитує більше ресурсів, ніж дозволяє алгоритм банкіра?" },
                    { 164, 13, 0, "[\"\\u0422\\u0430\\u043A, \\u044F\\u043A\\u0449\\u043E \\u043E\\u043D\\u043E\\u0432\\u043B\\u044E\\u0454\\u0442\\u044C\\u0441\\u044F \\u0431\\u0435\\u0437\\u043F\\u0435\\u0447\\u043D\\u0438\\u0439 \\u0441\\u0442\\u0430\\u043D\",\"\\u041D\\u0456, \\u0440\\u0435\\u0441\\u0443\\u0440\\u0441\\u0438 \\u043C\\u0430\\u044E\\u0442\\u044C \\u0431\\u0443\\u0442\\u0438 \\u0441\\u0442\\u0430\\u0442\\u0438\\u0447\\u043D\\u0438\\u043C\\u0438\",\"\\u041B\\u0438\\u0448\\u0435 \\u0443 \\u0431\\u0430\\u0433\\u0430\\u0442\\u043E\\u043F\\u0440\\u043E\\u0446\\u0435\\u0441\\u043E\\u0440\\u043D\\u0438\\u0445 \\u0441\\u0438\\u0441\\u0442\\u0435\\u043C\\u0430\\u0445\",\"\\u0422\\u0456\\u043B\\u044C\\u043A\\u0438 \\u0437 \\u0444\\u0456\\u043A\\u0441\\u043E\\u0432\\u0430\\u043D\\u043E\\u044E \\u043A\\u0456\\u043B\\u044C\\u043A\\u0456\\u0441\\u0442\\u044E \\u043F\\u0440\\u043E\\u0446\\u0435\\u0441\\u0456\\u0432\"]", "Чи може алгоритм банкіра працювати з динамічно змінюваними ресурсами?" },
                    { 165, 13, 0, "[\"\\u0428\\u0443\\u043A\\u0430\\u0454 \\u0431\\u0435\\u0437\\u043F\\u0435\\u0447\\u043D\\u0443 \\u043F\\u043E\\u0441\\u043B\\u0456\\u0434\\u043E\\u0432\\u043D\\u0456\\u0441\\u0442\\u044C \\u0432\\u0438\\u043A\\u043E\\u043D\\u0430\\u043D\\u043D\\u044F \\u043F\\u0440\\u043E\\u0446\\u0435\\u0441\\u0456\\u0432\",\"\\u0412\\u0438\\u043A\\u043E\\u043D\\u0443\\u0454 \\u0432\\u0441\\u0456 \\u043F\\u0440\\u043E\\u0446\\u0435\\u0441\\u0438 \\u043E\\u0434\\u043D\\u043E\\u0447\\u0430\\u0441\\u043D\\u043E\",\"\\u0410\\u043D\\u0430\\u043B\\u0456\\u0437\\u0443\\u0454 \\u043B\\u0438\\u0448\\u0435 \\u043F\\u0435\\u0440\\u0448\\u0438\\u0439 \\u043F\\u0440\\u043E\\u0446\\u0435\\u0441\",\"\\u0406\\u0433\\u043D\\u043E\\u0440\\u0443\\u0454 \\u043D\\u0435\\u0432\\u0438\\u043A\\u043E\\u0440\\u0438\\u0441\\u0442\\u0430\\u043D\\u0456 \\u0440\\u0435\\u0441\\u0443\\u0440\\u0441\\u0438\"]", "Як алгоритм банкіра визначає, чи безпечний поточний стан?" },
